                  var options = {"physics": {"enabled": false}, "layout": {"hierarchical": {"enabled": false}}, "nodes": {"font": {"color": "white"}, "shape": "dot"}, "edges": {"smooth": {"enabled": true, "type": "continuous"}, "font": {"color": "white", "size": 10, "align": "top"}}, "interaction": {"tooltipDelay": 200, "navigationButtons": true, "keyboard": true}};

                  


                  

                  network = new vis.Network(container, data, options);

                  

                  

                  


                  

                  return network;

              }
              drawGraph();
        </script>
